import {
  Button, StyleSheet, Text, View,
    ScrollView,
    Image,
    TouchableOpacity,
    Animated,
    FlatList, 
  Dimensions,
  Alert,
  TextInput
} from 'react-native';


export default function ProductCategories ({ route }) {
    console.log('route.params', route.params)
    const handleTouchEvent = ()=>{}
    return (
        <>
            <ScrollView>
                <TouchableOpacity
                    onPress={()=>{handleTouchEvent()}}

                >
                    <Image
                        source={require('../../assets/icon.png')}
                        style={{
                            width: 200,
                            height: 100,
                            
                        }}
                    />
                    <Text>Dall</Text>
               </TouchableOpacity>
                
            </ScrollView>

           
        </>
    )
}
 


const styles = StyleSheet.create({
    input: {
        backgroundColor: '#fff',
        borderWidth: 1,
        borderColor: 'black',
        borderRadius: 3,
        height: 50,
        margin: 5,
    }
})
